const user = {
  id: 1124,
  name: 'Morgrace Precious',
  image: 'https://i.pravatar.cc/48?u=1124',
};
const imageSlide = [
  '../../public/img/trophy-1.jpg',
  '../../public/img/trophy-2.jpg',
  '../../public/img/trophy-3.jpg',
];
const Header = function () {
  return (
    <header>
      <UserAccount />
      <DiamondToken />
      <Carousel />
    </header>
  );
};
const UserAccount = function () {
  return (
    <div>
      <img src={`${user['image']}`} alt="profile pix" />
      <div>
        <span>{user['name']}</span>
        <span>ID-{user['id']}</span>
      </div>
    </div>
  );
};
const DiamondToken = function () {
  return <div>160</div>;
};
const Carousel = function () {
  return <div className=" w-full h-[40vh] bg-[image: var(--bg-header)]"></div>;
};
export default Header;
